    data: |
      SELECT - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col2 + - 43 + + - col1 * col0 + + col0 * + 85 - + 82 + + col0 * + - col1 IS NOT NULL;
  - name: tab0

outputs:
  - name: q10419.out
    data: |
      -1
      -21
      -81
